import {get, post, request, gwRequest} from '~/utils/fetch'
export default {
  get_products: (params) => {
    return get(`products`, params)
  },
  get_product_detail: (id) => {
    return request(`products/${id}`, 'get', {})
  },
  add_product: (params) => {
    return request(`products`, 'post', params)
  },
  edit_product: (params) => {
    return request(`products`, 'post', params)
  },
  get_menu_list: () => {
    return request(`menu`, 'get', {})
  },
  getProduct4search: (params) => {
    return gwRequest('bank.api.distributestatisticsservice.getloannames', [
      params,
    ])
  },
  getLoanSummary: (params) => {
    return post(`financial/query/loanSummaryStatistics`, params)
  },
  loanSummaryStatisticsByProductId: (params) => {
    return post(`financial/query/loanSummaryStatisticsByProductId`, params)
  },
  getMechanism: (params) => {
    return post(`financial/query/statInstitutionalAssessment`, params)
  },
  getMarketing: (params) => {
    return post(`financial/query/marketingReports`, params)
  },
  getGrant: (params) => {
    return post(`financial/query/grantReports`, params)
  },
  takeBackReports: (params) => {
    return post(`financial/query/grantReports`, params)
  },
}
